class Test extends React.Component{
  state = {
    todos:[
      {
        id: 1,
        title: 'todo1',
        completed: false
      },
      {
        id: 2,
        title: 'todo2',
        completed: false
      },
      {
        id: 3,
        title: 'todo3',
        completed: false
      }
    ]
  }
  render(){
    return this.state.todos.map((todo) => (
      <div className="onedailygoal">
        <div className="onedailygoalheading">
            <h4>{todo.title} </h4>123
        </div>
      </div> 
    ));
  }
}
